import "./menu.css";
const Menu = () => {
  fetch("../../../../../data/navBar.json")
    .then((data) => {
      return data.text();
    })
    .catch((err) => {
      alert(err.message);
    })
    .then((data) => {
      console.log(data);
    });
  return (
    <nav className="navbar width-50">
      <div className="nav-item fs-6">Stay</div>
      <div className="nav-item fs-6">Flight</div>
      <div className="nav-item fs-6">Car Rentals</div>
      <div className="nav-item fs-6">Attractions</div>
      <div className="nav-item fs-6">Airport taxis</div>
    </nav>
  );
};

export default Menu;
